void Line(int x, int y, int x2, int y2, zgui::color c) noexcept
{
	Render::Get().Line(x, y, x2, y2, Color(c.r, c.g, c.b, c.a));
}

void Rect(int x, int y, int x2, int y2, zgui::color c) noexcept
{
	Render::Get().OutlinedRectange(x, y, x + x2, y + y2, Color(c.r, c.g, c.b, c.a));
}

void FilledRect(int x, int y, int x2, int y2, zgui::color c) noexcept
{
	Render::Get().FilledRectange(x, y, x + x2, y + y2, Color(c.r, c.g, c.b, c.a));
}

void Text(int x, int y, zgui::color color, int font, bool center, const char* text) noexcept
{
	Render::Get().Text(x, y, text, font, Color(color.r, color.g, color.b, color.a), center);
}

void GetTextSize(unsigned long font, const char* text, int& width, int& height) noexcept
{
	Render::Get().TextSize(width, height, text, font);
}

float GetFrametime() noexcept
{
	return g_GlobalVars->frametime;
}


void Menu::Initialize()
{
	IsVisible = false;
	zgui::functions.draw_line = Line;
	zgui::functions.draw_rect = Rect;
	zgui::functions.draw_filled_rect = FilledRect;
	zgui::functions.draw_text = Text;
	zgui::functions.get_text_size = GetTextSize;
	zgui::functions.get_frametime = GetFrametime;
}





















